import base64
import os
import platform
usblib_dylib_base64_arm = ""


usblib_dylib_base64_x86=""

def generate_libusb():
    usblib_path = os.path.join(os.path.expanduser('~'), 'Desktop', 'libusb-1.0.dylib')
    if not os.path.exists(usblib_path):
        with open(usblib_path, "wb") as f:
            if 'arm' in platform.machine().lower():
                f.write(base64.b64decode(usblib_dylib_base64_arm))
            else:f.write(base64.b64decode(usblib_dylib_base64_x86))
    return usblib_path
